function App() {
  return (
    <div>
      <h2>Let's get started!</h2>
      <label></label>
      <select id="ft-select">
        <option default value="#">
          Select a Team
        </option>
        <option value="volvo">Volvo</option>
      </select>
    </div>
  );
}

export default App;
